<p>ex: <a rel="nofollow" target="_blank" href="https://CDNsubdomain.CDNdomain.com/">https://CDNsubdomain.CDNdomain.com/</a><strong>USERNAME</strong>/wp-content/uploads/sites/5/2015/03/Untitled11.png</p>
<p>However, if you remove the <strong>USERNAME</strong> to related file url structure, such as:</p>
<p>ex: <a rel="nofollow" target="_blank" href="https://CDNsubdomain.CDNdomain.com/wp-content/uploads/sites/5/2015/03/Untitled11.png">https://CDNsubdomain.CDNdomain.com/wp-content/uploads/sites/5/2015/03/Untitled11.png</a> </p>
<p>It displays the media or image file. </p>
<p>Any suggestions or configuration considerations is greatly welcome.</p>
